import React from "react";
import ReactLoading from "react-loading";

export const list = [
  {
    prop: "balls",
    name: "Balls",
  },
  {
    prop: "bars",
    name: "Bars",
  },
  {
    prop: "bubbles",
    name: "Bubbles",
  },
  {
    prop: "cubes",
    name: "Cubes",
  },
  {
    prop: "cylon",
    name: "Cylon",
  },
  {
    prop: "spin",
    name: "Spin",
  },
  {
    prop: "spinningBubbles",
    name: "SpinningBubbles",
  },
  {
    prop: "spokes",
    name: "Spokes",
  },
];

const Loading = () => (
  <ReactLoading type={list[0].prop} color="#f0f0f0" height={667} width={375} />
);

export default Loading;
